import React, { Component } from 'react'

class ParentComponent extends Component {
    constructor(props) {
        super(props)

        this.state = {
             message: "I am parent"
        }
    }

    render() {
        return (
            <div>
                <p>{this.state.message}</p>
                <button>Change</button>
            </div>
        )
    }
}

export default ParentComponent
